import React from 'react';
import icon3 from "../media/sec4icon3.png";
function Section6() {
    return (
        <>
            <div className='section7'>
                <div className='sec7Content'>
            <p className='sec7desbefore'>OUR SERVICES</p>
                    <h4 className='sec7headmain'>Our Diverse Range of Services</h4>
                    <p className='sec7desafter'>Discover our wide range of real estate services tailored to meet your needs, from listings to investment guidance.</p>
                </div>
                <div class="cardsec7">
                    <img src={icon3} alt="Avatar" className='cardsec7img'/>
  <div class="containersec7">
    <h4><b>John Doe</b></h4>
    <p>Architect & Engineer</p>
  </div>
</div>
            </div>
        </>
    )
}
export default Section6;
